import React from 'react';

const Home = () => {
  return (
    <div style={{ padding: '20px', textAlign: 'center' }}>
      <h1 style={{ color: 'purple', fontSize: '48px' }}>RAVEN</h1>
      <p style={{ color: 'gray' }}>Testing TailwindCSS</p>
      {/* Test Tailwind class */}
      <div className="bg-red-500 text-white p-4 rounded-lg mt-4">
        If this is red, Tailwind is working
      </div>
      {/* Test gradient */}
      <div className="bg-gradient-to-r from-purple-500 to-blue-500 text-white p-4 rounded-lg mt-4">
        If gradient, Tailwind is working
      </div>
    </div>
  );
};

export default Home;
